class Sign {
    constructor(sign){
        this.sign = sign;
    }

    get sign(){
        return this.sign;
    }

    set sign(sn){
        this.sign = sn;
    }
}

const sn = new Sign('Username');

export default function Sn(){
    return sn.sign;
}
